import React from "react";
import ImageBGRemoved from "./ClothesImageBGRemover";
const ClothingImageCard = ({ clothingType, finalImage }) => {

  return (
    <div className="clothing-card">
      <h3>{clothingType}</h3>

      {<ImageBGRemoved image={finalImage} /> && (
        <img
          src={<ImageBGRemoved image={finalImage} />}
          alt={clothingType}
          style={{ width: "200px", borderRadius: "8px" }}
        />
      )}
    </div>
  );
};

export default ClothingImageCard;
